const sound = {
	_inited: false,
	_audios: {
		"data_uri_template": {
			_index: 0,
			_data_store: undefined,
			init: function () {
				this._data_store = [];
				for (let i = 0; i < 8; i++) {
					this._data_store.push(new Audio(this._data_uri));
				}
			},
			play: function () {
				this._data_store[this._index % this._data_store.length].play();
				this._index += 1;
			},
		},
		"default": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"peen": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"punch": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"kok": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"hyu": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"slash": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"temple_bell": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"taiko": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"hit": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"wooden_clappers": {
			_data_uri: "data:audio/mpeg;base64,",
		},
		"by_key": {
			_audioContext: undefined,
			_keyToFrequency: function (key) {
				const baseFreq = 220;
				const offset = key.charCodeAt(0) - 65;
				return baseFreq * Math.pow(2, offset / 12);
			},
			_getVolumeForFrequency: function (freq) {
				const referenceFreq = 440;
				const maxGain = 0.3;
				const minGain = 0.05;

				const gain = referenceFreq / freq * 0.1; // 周波数が小さいほど大きな音
				return Math.max(minGain, Math.min(maxGain, gain));
			},
			init: function () {
				this._audioContext = new (window.AudioContext || window.webkitAudioContext)();
			},
			play: function (params) {
				const freq = this._keyToFrequency(params.key.toUpperCase());
				const volume = this._getVolumeForFrequency(freq);

				const osc = this._audioContext.createOscillator();
				osc.type = 'sine';
				osc.frequency.setValueAtTime(freq, this._audioContext.currentTime);

				const gain = this._audioContext.createGain();
				gain.gain.setValueAtTime(volume, this._audioContext.currentTime);

				osc.connect(gain);
				gain.connect(this._audioContext.destination);

				osc.start();
				osc.stop(this._audioContext.currentTime + 0.3);
			},
		},
	},
	init: function () {
		if (this._inited) {
			return;
		}
		this._inited = true;
		Object.entries(this._audios).filter(([_, v]) => "_data_uri" in v).forEach(([k, v]) => {
			this._audios[k] = Object.create(this._audios.data_uri_template);
			this._audios[k]._data_uri = v._data_uri;
		})
		Object.entries(this._audios).filter(([k, _]) => k !== "data_uri_template").forEach(([k, v]) => {
			v.init();
		})
	},
	play: function (params = { type: "default" }) {
		this._audios[params.type]?.play(params);
	},
};
